import React from "react";
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom"; 

export function LinkList ({root, lis}) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
      <Link to={`${root}/${li.name}`}>
        <h3>{li.name}</h3>
        <img src={li.thumb} alt={li.thumb}/>
      </Link>
      </li>
    );
  });
  return(
    <ul>
      {elements}
    </ul>
  );
}

